INSERT INTO `activities` VALUES ('0222e613-f75f-4cc3-ac0e-0a8db0e950ec','038','Exame final','',NULL,NULL,NULL,'2021-01-07 06:58:00','176aa94f-3e4d-4f8d-af57-9d5f05d7cf6c',NULL,'2021-01-07 06:58:00',2,3),('02248d69-12bd-465d-878d-b3d7d5a72c81','049','¿Qué haces mañana?','<h3 class=\"h3 course-info-heading\" style=\" margin-top: 0px; margin-bottom: 0.5rem; font-weight: 700; line-height: 1.25; color: rgb(69, 69, 69); font-size: 2rem; font-family: Inter, &quot;Helvetica Neue&quot;, Arial, sans-serif; border-bottom: 0px; display: inline-block; font-style: normal; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255);\">Syllabus</h3><p style=\" margin-top: 0px; margin-bottom: 1rem; color: rgb(69, 69, 69); font-family: Inter, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 18px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255);\"><strong style=\" font-weight: bolder;\">Unit 3: ¿Qué haces mañana?</strong></p><p style=\" margin-top: 0px; margin-bottom: 1rem; color: rgb(69, 69, 69); font-family: Inter, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 18px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255);\">This Unit includes practice in describing how we feel, parts of the body, speaking on the phone, inviting someone to do something, and arranging to meet someone.</p>',2,NULL,NULL,'2021-01-07 15:12:19','6b7b04cc-779e-4b2c-b073-b6b3cd698dbb',NULL,'2021-01-07 13:52:31',1,0),('04855b9c-99fc-4fca-b2a7-4536cf2b8344','066','Certificado','',NULL,NULL,NULL,'2021-02-09 20:33:53','25b12c34-2ffe-4c7d-9a07-a7eed3c9d292',NULL,'2021-02-09 20:33:53',100,5),('08da38e9-c361-4e38-9402-dd1bb697b269','058','Exame final','',2,NULL,NULL,'2021-01-16 06:24:38','10074c2e-16f8-4a07-90aa-b63f10b00a00',NULL,'2021-01-15 15:06:43',97,3),('09459571-097f-4a76-8de1-7c2f1f1250d8','001','About this course','Do you feel innovation activity in your organization is ad-hoc? Are you looking for a systematic approach through which innovation capacity can be enhanced in your organization? Do you want answers to questions like what is innovation in business, what is innovation in entrepreneurship, importance of innovation in business, innovative ideas for business growth, and why businesses need to innovate, etc.\n\nThiscourse will show you how you can build aninnovation pipeline, improve idea velocity and enhance business impact through an8-steps approach.Moreover, we will also explore ways of sustaining participation in innovation activity.\n\nYou will get to learn some of the industry best practices. And also learn to apply the tools in your own context. For example, you will learn to create a challenge book that articulates the key challenges in your organization. Similarly, you will find ways to design low-cost experiments.\n\nWhether you are in a start-up or a large organization, in a hi-tech or low-tech business, product or services business, thiscoursewill have something for you to apply in your context and make your organization more innovative.',1,NULL,NULL,'2021-01-05 17:02:32','5a1163cc-1b0d-4834-b229-784b802222c9',NULL,'2020-12-24 06:46:37',0,0),('0b23d720-9ac4-4273-9c8c-87c4d0f0af69','065','Apresentação',NULL,NULL,NULL,NULL,'2021-02-09 20:33:53','68cd2f1c-6b8f-46fe-8a25-5b3ade9dd12e',NULL,'2021-02-09 20:33:53',95,0),('0da30199-b261-4cf1-bc82-3c28328f61be','004','Iniciar estudos','<p style=\"margin-top: 0px; margin-bottom: 1rem; color: rgb(69, 69, 69); font-family: Inter, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 18px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); cursor: auto;\">Begin your <strong>journey</strong> in a new career in marketing analytics. Learn about powerful strategies and methodology, starting with identifying market trends and metrics used to measure marketing success.</p><p style=\"margin-top: 0px; margin-bottom: 1rem; color: rgb(69, 69, 69); font-family: Inter, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 18px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); cursor: auto;\"><br></p><p style=\"margin-top: 0px; margin-bottom: 1rem; color: rgb(69, 69, 69); font-family: Inter, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 18px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); cursor: auto;\">In this marketing course, you will learn how to execute market sizing, identify market trends, and predict future conditions.<br></p><p style=\" margin-top: 0px; margin-bottom: 1rem; color: rgb(69, 69, 69); font-family: Inter, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 18px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255);\">This course is taught by Stephan Sorger who has held leadership roles in marketing and product development at companies such as Oracle, 3Com and NASA. He has also taught for over a decade at UC Berkeley Extension and is the author of two widely adopted marketing textbooks. This course will equip you with the knowledge and skills <span style=\"text-decoration: underline;\">necessary</span> to immediately see practical benefits in the workplace.</p><p style=\" margin-top: 0px; margin-bottom: 1rem; color: rgb(69, 69, 69); font-family: Inter, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 18px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255);\">Analytics-based marketing is increasingly important in determining a company’s spending and ROI. Many entry-level positions in marketing now require some basic level of knowledge in this rapidly growing field.</p>',1,NULL,NULL,'2021-01-11 08:29:38','14a17e3e-b443-4d06-b0db-0c3341438fa0',NULL,'2020-12-26 17:46:59',0,0),('123701c7-6f2a-44d0-aa92-3fd5f0bea566','062','Apresentação','Modern Asynchronous JavaScript with Async and Await\nJavaScript Loops and Scope\nThe Map JavaScript Data Structure\nThe Set JavaScript Data Structure\nA guide to JavaScript Template Literals\nRoadmap to Learn JavaScript',NULL,NULL,NULL,'2021-02-10 10:32:48','97cae268-ff83-4a2f-bb78-cf2f1595b694',NULL,'2021-02-09 20:29:46',95,0),('1389d9b3-f15c-4d95-b053-b52f9f099c80','063','Exame final','',2,NULL,NULL,'2021-02-10 10:37:44','c14bedeb-39b0-4186-a319-b986db511ca9',NULL,'2021-02-09 20:29:46',97,3),('16f3b308-a325-4543-92ba-fb324a19f1b4','006','Getting start','<p><span style=\"color: rgb(69, 69, 69); font-family: Inter, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 18px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); display: inline !important; float: none;\">Short of breathing, the one activity that humans engage in the most is communication. In a business scenario, communication not only helps us share our thoughts but is essential in getting our work done and becoming more successful.</span><br></p>',1,NULL,NULL,'2020-12-31 12:24:25','c56b0049-fc8d-42b8-a310-76f5089cd7ff',NULL,'2020-12-28 14:16:54',1,0),('187bcb57-dcb4-4ca5-b703-fb8a31c0f96f','073','Index of obj in arr','<p style=\"line-height: 1.7em; margin: 0px 0px 30px; color: rgb(66, 66, 66); font-family: Avenir, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Oxygen, Ubuntu, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 20px; font-style: normal; font-weight: 400; text-align: start; text-indent: 0px; white-space: normal; background-color: rgb(254, 254, 254);\"><code style=\"font-family: Inconsolata, monospace; font-size: 20px; padding: 2px 4px; color: rgb(68, 68, 68); background-color: rgb(241, 240, 234); border-radius: 4px;\">index</code><span>&nbsp;</span>will be<span>&nbsp;</span><code style=\"font-family: Inconsolata, monospace; font-size: 20px; padding: 2px 4px; color: rgb(68, 68, 68); background-color: rgb(241, 240, 234); border-radius: 4px;\">-1</code><span>&nbsp;</span>which means the item was not found. Because objects are compared by reference, not by their values (differently for primitive types). The object passed to<span>&nbsp;</span><code style=\"font-family: Inconsolata, monospace; font-size: 20px; padding: 2px 4px; color: rgb(68, 68, 68); background-color: rgb(241, 240, 234); border-radius: 4px;\">indexOf</code><span>&nbsp;</span>is a completely different object than the second item in the array.</p><p style=\"line-height: 1.7em; margin: 0px 0px 30px; color: rgb(66, 66, 66); font-family: Avenir, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Oxygen, Ubuntu, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 20px; font-style: normal; font-weight: 400; text-align: start; text-indent: 0px; white-space: normal; background-color: rgb(254, 254, 254);\">You can use the<span>&nbsp;</span><code style=\"font-family: Inconsolata, monospace; font-size: 20px; padding: 2px 4px; color: rgb(68, 68, 68); background-color: rgb(241, 240, 234); border-radius: 4px;\">findIndex</code><span>&nbsp;</span>value like this, which runs a function for each item in the array, which is passed the element, and its index. Returning from it will assign the return value to the return value of<span>&nbsp;</span><code style=\"font-family: Inconsolata, monospace; font-size: 20px; padding: 2px 4px; color: rgb(68, 68, 68); background-color: rgb(241, 240, 234); border-radius: 4px;\">findIndex</code>:</p><div class=\"highlight\" style=\"color: rgb(66, 66, 66); font-family: Avenir, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Oxygen, Ubuntu, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 20px; font-style