n in innovation activity.&#10;&#10;You will get to learn some of the industry best practices. And also learn to apply the tools in your own context. For example, you will learn to create a challenge book that articulates the key challenges in your organization. Similarly, you will find ways to design low-cost experiments.&#10;&#10;Whether you are in a start-up or a large organization, in a hi-tech or low-tech business, product or services business, thiscoursewill have something for you to apply in your context and make your organization more innovative.',1,NULL,NULL,'2021-01-09 11:51:44','5a1163cc-1b0d-4834-b229-784b802222c9',NULL,'2020-12-24 06:47:18',2,0),('8e8c2c14-8c09-44ae-b19f-2d66a0815e0f','018','Avaliação do perfil de entrada','',NULL,NULL,NULL,'2021-01-05 18:57:50','30e90364-ed05-4495-bd06-8fe609a51a84',NULL,'2021-01-05 18:57:50',0,0),('90916c0d-1f88-43a7-be6b-4def1c02ca0a','064','Avaliação do perfil de entrada','',NULL,NULL,NULL,'2021-02-09 20:33:53','68cd2f1c-6b8f-46fe-8a25-5b3ade9dd12e',NULL,'2021-02-09 20:33:53',96,3),('92f67845-99e4-4bc7-b03d-b6b91e045f07','059','Avaliação do curso','',15,NULL,NULL,'2021-01-15 15:06:46','10074c2e-16f8-4a07-90aa-b63f10b00a00',NULL,'2021-01-15 15:06:46',99,3),('975bd6f8-ce66-40a2-a5ac-0f32688ebdd4','051','Avaliação do perfil de entrada','',NULL,NULL,NULL,'2021-01-08 16:46:24','c4d4d616-6653-4dd7-80b8-587f02815e6d',NULL,'2021-01-08 16:46:24',100,3),('9827d41d-9042-4520-a629-553921702f29','052','Certificado',NULL,0,NULL,NULL,'2021-01-09 15:11:09','54e42aad-e08f-4143-b5dc-4ba3dbae3ab9',NULL,'2021-01-09 15:11:09',5,100),('989fee0e-53e0-47dd-87e5-fcb056ad83fb','080','PDF Test',NULL,1,NULL,'/courses/033/attachment/cover-e8289e80.pdf','2021-02-12 18:34:24','b76966e8-e22d-43b7-82fd-868ebff5526d',NULL,'2021-02-12 18:34:24',2,1),('99704601-c4c4-4354-a699-35d9fe133a5d','009','Wanda vision',NULL,3,NULL,'/courses/005/attachment/cover-35098d67.mp4','2021-01-05 16:47:29','e2c8ba37-8a34-4e04-a10f-ae730273cfa7',NULL,'2020-12-29 23:17:18'