/wiki/Tribo_urbana\" title=\"Tribo urbana\" style=\"text-decoration: none; color: rgb(11, 0, 128); background: none;\">tribo urbana</a>, muito embora possua características gerais mais imprecisas do que a maioria delas, e embora também não preceda à autoidentificação. A ideia de \"nerd\" está profundamente atrelada, historicamente, à<span>&nbsp;</span><a href=\"https://pt.wikipedia.org/wiki/Adolesc%C3%AAncia\" title=\"Adolescência\" style=\"text-decoration: none; color: rgb(11, 0, 128); background: none;\">adolescência</a><span>&nbsp;</span>e<span>&nbsp;</span><a href=\"https://pt.wikipedia.org/wiki/Juventude\" title=\"Juventude\" style=\"text-decoration: none; color: rgb(11, 0, 128); background: none;\">juventude</a>,<sup id=\"cite_ref-Patrícia_Matos_1-0\" class=\"reference\" style=\"line-height: 1; white-space: nowrap; font-weight: normal; font-style: normal; font-size: 11.2px;\"><a href=\"https://pt.wikipedia.org/wiki/Nerd#cite_note-Patr%C3%ADcia_Matos-1\" style=\"text-decoration: none; color: rgb(11, 0, 128); background: none; white-space: nowrap;\"><span>[</span>1<span>]</span></a></sup><span>&nbsp;</span>bem como à cultura do<span>&nbsp;</span><a href=\"https://pt.wikipedia.org/wiki/Educa%C3%A7%C3%A3o_nos_Estados_Unidos\" title=\"Educação nos Estados Unidos\" style=\"text-decoration: none; color: rgb(11, 0, 128); background: none;\">sistema escolar dos Estados Unidos</a>, ainda que também tenha sido exportada para outros países. Em termos gerais, o nerd é uma pessoa vista como excessivamente<span>&nbsp;</span><a href=\"https://pt.wikipedia.org/wiki/Intelectual\" title=\"Intelectual\" style=\"text-decoration: none; color: rgb(11, 0, 128); background: none;\">intelectual</a>, obsessiva por assuntos que a maioria das pessoas não se interessa, e com falta de habilidades sociais<sup id=\"cite_ref-2\" class=\"reference\" style=\"line-height: 1; white-space: nowrap; font-weight: normal; font-style: normal; font-size: 11.2px;\"><a href=\"https://pt.wikipedia.org/wiki/Nerd#cite_note-2\" style=\"text-decoration: none; color: rgb(11, 0, 128); background: none; white-space: nowrap;\"><span>[</span>2<span>]</span></a></sup><span>&nbsp;</span>fora do meio nerd. Tal pessoa pode gastar quantidades excessivas de tempo em atividades impopulares, pouco conhecidas ou não, que geralmente são altamente técnicas, complexas, abstratas ou relacionadas a livros filmes e séries de<span>&nbsp;</span><a href=\"https://pt.wikipedia.org/wiki/Fic%C3%A7%C3%A3o\" title=\"Ficção\" style=\"text-decoration: none; color: rgb(11, 0, 128); background: none;\">ficção</a><span>&nbsp;</span>ou<span>&nbsp;</span><a href=\"https://pt.wikipedia.org/wiki/Fantasia_(g%C3%AAnero)\" title=\"Fantasia (gênero)\" style=\"text-decoration: none; color: rgb(11, 0, 128); background: none;\">fantasia</a>, com exclusão de atividades mais comuns.<sup id=\"cite_ref-3\" class=\"reference\" style=\"line-height: 1; white-space: nowrap; font-weight: normal; font-style: normal; font-size: 11.2px;\"><a href=\"https://pt.wikipedia.org/wiki/Nerd#cite_note-3\" style=\"text-decoration: none; color: rgb(11, 0, 128); background: none; white-space: nowrap;\"><span>[</span>3<span>]</span></a></sup><sup id=\"cite_ref-4\" class=\"reference\" style=\"line-height: 1; white-space: nowrap; font-weight: normal; font-style: normal; font-size: 11.2px;\"><a href=\"https://pt.wikipedia.org/wiki/Nerd#cite_note-4\" style=\"text-decoration: none; color: rgb(11, 0, 128); background: none; white-space: nowrap;\"><span>[</span>4<span>]</span></a></sup><sup id=\"cite_ref-webster_5-0\" class=\"reference\" style=\"line-height: 1; white-space: nowrap; font-weight: normal; font-style: normal; font-size: 11.2px;\"><a href=\"https://pt.wikipedia.org/wiki/Nerd#cite_note-webster-5\" style=\"text-decoration: none; color: rgb(11, 0, 128); background: none; white-space: nowrap;\"><span>[</span>5<span>]</span></a></sup><span>&nbsp;</span>Além disso, muitos chamados nerds são descritos como sendo<span>&nbsp;</span><a href=\"https://pt.wikipedia.org/wiki/Timidez\" title=\"Timidez\" style=\"text-decoration: none; color: rgb(11, 0, 128); background: none;\">tímidos</a><span>&nbsp;</span>e<span>&nbsp;</span><a href=\"https://pt.wikipedia.org/wiki/Excentricidade_(comportamento)\" title=\"Excentricidade (comportamento)\" style=\"text-decoration: none; color: rgb(11, 0, 128); background: none;\">excêntricos</a><span>&nbsp;</span>,<sup id=\"cite_ref-6\" class=\"reference\" style=\"line-height: 1; white-space: nowrap; font-weight: normal; font-style: normal; font-size: 11.2px;\"><a href=\"https://pt.wikipedia.org/wiki/Nerd#cite_note-6\" style=\"text-decoration: none; color: rgb(11, 0, 128); background: none; white-space: nowrap;\"><span>[</span>6<span>]</span></a></sup><span>&nbsp;</span>bem como com muitas dificuldades em praticar, ou mesmo acompanhar<span>&nbsp;</span><a href=\"https://pt.wikipedia.org/wiki/Esporte\" class=\"mw-redirect\" title=\"Esporte\" style=\"text-decoration: none; color: rgb(11, 0, 128); background: none;\">esportes</a>.</p><p style=\"margin: 0.5em 0px; color: rgb(32, 33, 34); font-family: sans-serif; font-size: 14px; font-style: normal; font-weight: 400; text-align: start; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255);\">Embora originalmente tivesse<span>&nbsp;</span><a href=\"https://pt.wikipedia.org/wiki/Conota%C3%A7%C3%A3o\" title=\"Conotação\" style=\"text-decoration: none; color: rgb(11, 0, 128); background: none;\">conotação</a><span>&nbsp;</span>depreciativa,<span>&nbsp;</span><i>nerd</i><span>&nbsp;</span>é um termo<span>&nbsp;</span><a href=\"https://pt.wikipedia.org/wiki/Estere%C3%B3tipo\" title=\"Estereótipo\" style=\"text-decoration: none; color: rgb(11, 0, 128); background: none;\">estereotipado</a>, mas como ocorreu com outros termos pejorativos, ele foi refinado e redefinido por alguns como um termo de<span>&nbsp;</span><a href=\"https://pt.wikipedia.org/wiki/Orgulho\" title=\"Orgulho\" style=\"text-decoration: none; color: rgb(11, 0, 128); background: none;\">orgulho</a><span>&nbsp;</span>e identidade de grupo.<sup id=\"cite_ref-Guilherme_7-0\" class=\"reference\" style=\"line-height: 1; white-space: nowrap; font-weight: normal; font-style: normal; font-size: 11.2px;\"><a href=\"https://pt.wikipedia.org/wiki/Nerd#cite_note-Guilherme-7\" style=\"text-decoration: none; color: rgb(11, 0, 128); background: none; white-space: nowrap;\"><span>[</span>7<span>]</span></a></sup><span>&nbsp;</span>Atualmente no entanto o termo nerd vem sendo usado por determinados grupos relacionados a interesses específicos como forma de se identificarem.</p>',5,NULL,NULL,'2020-12-31 12:02:23','e2c8ba37-8a34-4e04-a10f-ae730273cfa7',NULL,'2020-12-31 09:25:05',0,0),('ba6f49b3-9ff9-4e6b-b5f4-3f31e654a110','040','Avaliação do perfil de entrada','',NULL,NULL,NULL,'2021-01-07 06:58:22','2e138e71-a35c-4cd6-956d-2606aed18ae6',NULL,'2021-01-07 06:58:22',100,3),('bdf77bae-a4a2-4911-a9c3-deb9572b6c2f','046','Avaliação do curso','',15,NULL,NULL,'2021-01-07 07:16:22','c59f90bf-6577-42b5-bb83-32bb6c1b4614',NULL,'2021-01-07 07:16:22',99,3),('be9acb72-00b0-42d9-a0db-fb9986fcb391','007','What you\'ll learn','<h2 style=\" margin: 0px 0px 5px; font-weight: 800; line-height: 1.2em; color: rgb(18, 18, 18); font-size: 25px; font-family: &quot;Source Sans Pro&quot;, sans-serif; font-style: normal; text-align: start; text-indent: 0px; white-space: normal;\">Radio Buttons with Angular 7|8|9 Reactive Forms</h2><p style=\" margin: 0px 0px 1.5em; color: rgb(18, 18, 18); font-family: &quot;Source Sans Pro&quot;, sans-serif; font-size: 19px; font-style: normal; font-weight: 400; text-align: start; text-indent: 0px; white-space: normal;\">Now I am going to build radio buttons using Angular reactive forms. I will show you how to implement, set selected value and validate radio buttons in Angular app. I’ll use Reactive Form’s FormBuilder, FormControl, and ReactiveFormsModule service to handle radio buttons.</p>',3,NULL,'https://www.youtube.com/embed/iZpkQlaq6tY','2021-01-05 16:41:24','c56b0049-fc8d-42b8-a310-76f5089cd7ff',NULL,'2020-12-28 14:21:45',0,0),('c07eadce-4494-40d0-8031-89a9d61bb448','056','Exame final','',NULL,NULL,NULL,'2021-01-15 14:55:51','164d26b6-8254-4c84-a449-6ba21c06d548',NULL,'2021-01-15 14:55:51',97,3),('c72dff5a-6077-49eb-ac1c-b332a9c7ea5b','031',NULL,'',NULL,NULL,NULL,'2021-01-06 17:12:49','4f1fa026-8af0-4992-8ace-b3c52289c107',NULL,'2021-01-06 17:12:49',99,3),('c97e6712-ed12-4178-9be8-1b975a996644','020','Avaliação do perfil de entrada','',15,NULL,NULL,'2021-01-06 09:33:22','0c50754a-dde8-40cc-b140-ce1cbd30bfea',NULL,'2021-01-06 06:40:22',-1,3),('cb48af46-c116-4cd9-941f-3584977a3803','083','Certificado','',NULL,NULL,NULL,'2021-04-10 11:36:50','7cf315f8-7ea3-4fe6-87c5-698e7942da50',NULL,'2021-04-10 11:36:50',100,100),('cdef61c0-1690-481e-8f93-9b539f0dbecc','003','Exercising Leadership: Foundational Principles','<p><b>What you\'ll learn\nSkip What</b></p><div>you\'ll learn\nIn this short introductory course,&nbsp;</div><div><ul><li>you will discover a&nbsp;</li><li>diagnostic-and-action&nbsp;</li><li>process for exercising&nbsp;</li></ul></div><div>leadership that explores the following foundational principles and strategies:\n\nHow to identify and unbundle complex challenges\nHow to understand the role of <i><u>formal</u></i> and informal authority\nHow to identify the key perspectives of stakeholders\nHow to build and renew trust relationships\nHow to approach conflict\nHow to implement personal&nbsp;</div><div><img width=\"300px\" src=\"http://localhost:9800/courses/005/cover-35098d67.png\" class=\"e-rte-image e-imginline e-resize\" style=\"\"></div><div>strategies for surviving and thriving amidst change\nCollapse what you\'ll learn\nSyllabus\nSkip Syllabus\nIntroduction: Get on the Balcony\n1 Identify the Work to Be Done\n2 Lead With, Beyond, and Without Authority\n3.1 Take Action: Think Politically\n3.2 Take Action: Build Trust\n3.3 Take Action: Orchestrate Conflict\n4 Anchor Yourself\nConclusion: Staying Alive</div>',1,NULL,NULL,'2021-01-09 11:50:14','5a1163cc-1b0d-4834-b229-784b802222c9',NULL,'2020-12-24 07:11:25',1,0),('d0c38be4-40da-47f2-9676-a69fb994fff0','071','Rejoinin\'','<p><code style=\"font-family: Inconsolata, monospace; font-size: 20px; padding: 2px 4px; color: rgb(68, 68, 68); background-color: rgb(241, 240, 234); border-radius: 4px; font-style: normal; font-weight: 400; text-align: start; text-indent: 0px; white-space: normal;\">index</code><span style=\"color: rgb(66, 66, 66); font-family: Avenir, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Oxygen, Ubuntu, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 20px; font-style: normal; font-weight: 400; text-align: start; text-indent: 0px; white-space: normal; background-color: rgb(254, 254, 254); display: inline !important; float: none;\"><span>&nbsp;</span>will be<span>&nbsp;</span></span><code style=\"font-family: Inconsolata, monospace; font-size: 20px; padding: 2px 4px; color: rgb(68, 68, 68); background-color: rgb(241, 240, 234); border-radius: 4px; font-style: normal; font-weight: 400; text-align: start; text-indent: 0px; white-space: normal;\">-1</code><span style=\"color: rgb(66, 66, 66); font-family: Avenir, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Oxygen, Ubuntu, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 20px; font-style: normal; font-weight: 400; text-align: start; text-indent: 0px; white-space: normal; background-color: rgb(254, 254, 254); display: inline !important; float: none;\"><span>&nbsp;</span>which means the item was not found. Because objects are compared by reference, not by their values (differently for primitive types). The object passed to<span>&nbsp;</span></span><code style=\"font-family: Inconsolata, monospace; font-size: 20px; padding: 2px 4px; color: rgb(68, 68, 68); background-color: rgb(241, 240, 234); border-radius: 4px; font-style: normal; font-weight: 400; text-align: start;