; font-size: 18px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255);\"><span>Unfortunately, learners from one or more of the following countries or regions will not be able to register for this course: Iran, Cuba and the Crimea region of Ukraine. While edX has sought licenses from the U.S. Office of Foreign Assets Control (OFAC) to offer our courses to learners in these countries and regions, the licenses we have received are not broad enough to allow us to offer this course in all locations. EdX truly regrets that U.S. sanctions prevent us from offering all of our courses to everyone, no matter where they live.</span></p>',15,NULL,NULL,'2021-01-11 08:28:48','14a17e3e-b443-4d06-b0db-0c3341438fa0',NULL,'2020-12-26 17:50:00',1,0),('da77f518-47ac-4ad4-8546-a22f002e879f','060','credenciales-digitales','<p style=\" margin-top: 0px; margin-bottom: 1rem; color: rgb(69, 69, 69); font-family: Inter, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 18px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255);\">El 61% de los estudiantes que han realizado el curso afirman que mejoraron su capacidad para formular, implementar y/o evaluar políticas públicas.</p><p style=\" margin-top: 0px; margin-bottom: 1rem; color: rgb(69, 69, 69); font-family: Inter, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 18px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255);\">52% de los estudiantes han dicho que el curso les ha servido para mejorar los servicios a los ciudadanos como funcionarios públicos.</p>',1,NULL,NULL,'2021-01-15 15:31:20','ccebc9a1-1a4f-426d-8189-e3102a5ecd86',NULL,'2021-01-15 15:31:20',1,0),('db54da9a-a7f9-4b7c-a35d-1278995eac3f','010','Exercicios',NULL,5,NULL,NULL,'2021-01-09 11:17:23','e2c8ba37-8a34-4e04-a10f-ae730