INSERT INTO `courses` VALUES ('03ba2b27-e0e2-4a71-a42b-8be14bec33c8','015','Using Email for Networking in English','Skip About this course\nEffective writing is an important business skill, especially for networking, and most communication takes place using email.\n\nIn this course, you’ll learnimportant vocabulary and strategies for writing effective emails, starting with the subject line. You\'ll learn how to write messages for different audiences and understand when tobe formal or direct.You’llalso learn how your choice of words can change the way people view your message.You\'ll practice writing emails to follow up with people in your network.',NULL,NULL,'EN',0,'/courses/015/cover-03ba2b27.png','PROFESSIONAL','2021-01-06 09:27:56',NULL,'2021-01-06 06:40:21',0),('0c2b75f8-1c39-416d-9a85-2c12a4885e60','017','Spanish 2: One Step Further','Bienvenidos y bienvenidas! (Welcome!) In this Spanish course, you will learn basic vocabulary to talk about yourself and your everyday life, in the present and in the past, in simple and brief communication situations, as well as about plans for an immediate future. At the end of the course you will be able to communicate in everyday situations according to the A1 proficiency level as described in the Common European Framework of Reference for Languages (CEFRL, Council of Europe).\n\nThe course, which is designed for English speakers, offers a variety of exercises after going through the stages of content presentation, comprehension and production. You have videos, small texts and audios to improve your pronunciation, glossaries, activities for oral practice with other course students, quizzes, grammar cards and recommendations on external Internet resources to continue learning more and more Spanish.\n\nThe topics on which the activities revolve are work life, family life, city life and outdoor life. As you can see, a bit of everything to be able talk about yourself and to engage in everyday communication.\n\nWe hope you like our menu. ¡Buen provecho! (Bon appétit!)',NULL,NULL,'EN',1,NULL,'BASIC_PROFESSIONAL','2021-01-06 16:53:52',NULL,'2021-01-06 16:53:52',0),('0def5d88-b174-4726-b64c-f94c01dafba1','021','Spanish 4: Upper pass','¡Bienvenidos y bienvenidas! (Welcome!)\n\nIn this Spanish course, you will learn basic vocabulary to talk about yourself and your everyday life, in the present, in the future and in the past, in simple and brief communication situations. You will learn expressions of time, how to express things that will happen in the future, vocabulary related to the shopping list, how to express an opinion, talking about your health, and about experiences and activities that happened in the past. At the end of the course you will be able to communicate in everyday situations according to the A2 proficiency level (elementary) as described in the Common European Framework of Reference for Languages ​​(CEFRL, Council of Europe).\n\nThe course, which is designed for English speakers, offers a variety of exercises after going through the stages of content presentation, comprehension and production. You have videos, small texts and audios to improve your pronunciation, glossaries, activities for oral practice with other course students, quizzes, grammar cards and recommendations on external Internet resources to continue learning more and more Spanish.\n\nThe topics on which the activities revolve are work life, family life, city life and outdoor life. As you can see, a bit of everything to be able talk about yourself and to engage in everyday communication.\n\nWe hope you like our menu. ¡Buen provecho! (Bon appétit!)',NULL,NULL,'EN',2,NULL,'PROFESSIONAL','2021-01-07 06:48:11',NULL,'2021-01-07 06:48:11',0),('10eb73ec-860e-4faf-a335-9a861e08184c','030','StartUp course','Modern Asynchronous JavaScript with Async and Await\nJavaScript Loops and Scope\nThe Map JavaScript Data Structure\nThe Set JavaScript Data Structure\nA guide to JavaScript Template Literals\nRoadmap to Learn JavaScript',NULL,1,NULL,0,'/courses/030/cover-10eb73ec.jpeg','FREE','2021-02-12 18:15:57',NULL,'2021-02-09 20:29:45',0),('16e50c11-82cf-42d6-a591-0c75acd22990','016','Basic Spanish','Learn Spanish and explore Spanish culture in this introductory language course, designed for English speakers.\n\nThis 7-week Spanish language course is aimed at students who would like to learn conversational Spanish starting with Spanish basics. The course introduces everyday language and includes activities to practice all four language skills: reading comprehension, writing, listening comprehension and speaking.',NULL,NULL,'EN',0,'/courses/016/cover-16e50c11.jpeg','BASIC_FREE_PROFESSIONAL','2021-01-06 16:28:58',NULL,'2021-01-06 16:28:58',0),('1baa0dfb-4b2a-4f5f-8f50-f073070ab511','025','Basic Spanish','Basic vocabulary to be able to use and understand information related to:\n\ndaily routine and work\n\ndaily activities at home and with the family\n\nleisure activities\n\nlife in the city\n\nBasic grammatical structures such as articles and nouns, adjectives, present, future and past tenses of regular and irregular verbs.',NULL,NULL,'EN',0,'/courses/025/cover-1baa0dfb.jpeg','FREE_BASIC_PROFESSIONAL','2021-01-07 11:23:44',NULL,'2021-01-07 07:15:13',0),('2f9ed600-2cb5-4b0a-8766-38a0faf5aff3','029','Educación sobre el cambio climático','ABC',NULL,NULL,'ES',0,'/courses/029/cover-2f9ed600.jpeg','FREE','2021-01-15 15:06:55',NULL,'2021-01-15 15:06:43',0),('35098d67-d0fa-46a0-8aed-8185c60cdc91','005','Découvrir la responsabilité sociétale des entreprises (RSE)','Revisitez la finalité des entreprises et explorez avec nous ce qu’est leur responsabilité sociétale. Passez au leadership responsable ! Apprenez à mettre en place une stratégie crédible de RSE dans une entreprise, quelle que soit sa taille.\n\nVous serez confrontés à différents cas d’entreprises, qui vous permettront de comprendre les défis auxquels font face les managers qui cherchent à développer une stratégie responsable. Vous serez également amenés à interagir entre vous sur les forums de discussion.\n\nCe cours vise à vous aider à gérer la RSE avec différentes parties prenantes internes et externes. Il vise en particulier à soutenir les managers actuel.les et futur.es dans leurs efforts pour positionner un leadership responsable, une production et une consommation durable au centre de leur vision stratégique.',NULL,NULL,'FR',1,'/courses/005/cover-35098d67.png','PRO','2021-01-05 15:30:26',NULL,'2020-12-23 15:22:02',0),('4458c0b3-06ee-478d-a24a-694d3b0ec5c6','002','Inclusive Leadership Training','What separates a successful leader from a mediocre one? In this course, you will learn what successful 21st-century leaders look like and how you can adopt their inclusive leadership style. Using research and best practices, as well as stories from great leaders and everyday people, you will practice empowerment, accountability, courage, and humility—key leadership skills linked to inclusive, successful teams. Throughout the course, you will meet people like yourself, who want to be the best leaders they possibly can by incorporating inclusive leadership into their everyday lives. With short quizzes and compelling case studies, you will refine your skills each section. Most importantly, you will apply your new leadership skills through exciting real-life exercises. At the end of the course, you will create a Personal Leadership Plan that will help you continue to develop your skills, knowledge, and awareness in your quest to become a successful, inclusive leader.',NULL,NULL,'EN',0,'/courses/002/cover-4458c0b3.jpeg',NULL,'2020-12-23 18:55:02',NULL,'2020-12-23 11:35:01',0),('4b1edc61-a925-47eb-b73f-8cd75442c1f6','028','How New Ideas Take Root','Conceptual Change: How New Ideas Take Root — explores the ways students learn and develop new conceptual understandings, and shows how student misconceptions can be uncovered and addressed as a part of effective learning.\n\n',NULL,1,NULL,0,'/courses/028/cover-4b1edc61.jpeg','PROFESSIONAL','2021-02-09 18:58:11',NULL,'2021-01-15 14:55:51',0),('54a87ecf-180f-4d20-a9f6-2b318ada8dfb','027','Strategies for Online Teaching and Learning','In this course, you’ll receive useful tips and case studies to improve your online teaching, with specific resources and activities tailored to primary, secondary and adult/higher education. As with the other courses in this certificate, you’ll have the opportunity to learn amongst a vibrant community of international educators, and can feel confident knowing that you will be acquiring skills backed by sound pedagogical methodologies. ****',NULL,NULL,NULL,1,'/courses/027/cover-54a87ecf.png','FREE','2021-01-15 14:40:48',NULL,'2021-01-15 14:40:47',0),('62e3b342-7ee0-4056-8c71-b27b86f3b531','034','Strip DOCs','Payments infrastructure for the internet\nMillions of companies of all sizes—from startups to Fortune 500s—use Stripe’s software and APIs to accept payments, send payouts, and manage their businesses online.\nAdd payment methods\nIntegrate digital wallets like Alipay, Apple Pay, and Google Pay, or let customers pay with other payment methods like bank debits or transfers. Payment methods help boost conversion.',NULL,NULL,'EN',0,'/courses/034/cover-62e3b342.jpeg','FREE','2021-04-10 11:37:19',NULL,'2021-04-10 11:36:50',1),('6b6a1381-1a2c-466d-ab41-d0b72241f8e2','003','Becoming a Successful Leader','who want to be the best leaders they possibly can by incorporating inclusive leadership into their everyday lives. With short quizzes and compelling case studies, you will refine your skills each section. Most importantly, you will apply your new leadership skills through exciting real-life exercises. At the end of the course, you will create a Personal Leadership Plan that will help you continue to develop your skills, knowledge, and awareness in your quest to become a successful, inclusive leader.',NULL,NULL,NULL,0,'/courses/003/cover-6b6a1381.jpeg',NULL,'2020-12-23 11:36:23',NULL,'2020-12-23 11:36:23',0),('714f9c84-2315-4a4c-bf81-7e837b082b95','026','Introduction to Investments','The investment landscape can be extremely dynamic and ever-evolving. But those who take the time to understand the basic principles and the different asset classes stand to gain significantly over the long haul. The first step is learning to distinguish different types of investments and what rung each occupies on the \"risk ladder.',NULL,NULL,'EN',0,'/courses/026/cover-714f9c84.jpeg','PROFESSIONAL','2021-01-08 16:46:24',NULL,'2021-01-08 16:46:23',0),('71d128a2-8b39-470f-aac8-b39150146202','001','Computer Forensics','The course team is available to answer questions in the discussion topic titled \"Questions About the Course.\" You can also check the FAQs by clicking on the link in the top toolbar. In addition, we will send occasional email updates that highlight themes generated in the activities and discussion areas.\n\nHere’s how to get started…',NULL,NULL,'EN',0,'/courses/001/cover-71d128a2.jpeg',NULL,'2020-12-24 03:24:43',NULL,'2020-12-23 11:28:32',0),('75a63709-a054-4db6-afc1-0e4481908acb','018','Spanish 2: One Step Further','Bienvenidos y bienvenidas! (Welcome!) In this Spanish course, you will learn basic vocabulary to talk about yourself and your everyday life, in the present and in the past, in simple and brief communication situations, as well as about plans for an immediate future. At the end of the course you will be able to communicate in everyday situations according to the A1 proficiency level as described in the Common European Framework of Reference for Languages (CEFRL, Council of Europe).\n\nThe course, which is designed for English speakers, offers a variety of exercises after going through the stages of content presentation, comprehension and production. You have videos, small texts and audios to improve your pronunciation, glossaries, activities for oral practice with other course students, quizzes, grammar cards and recommendations on external Internet resources to continue learning more and more Spanish.\n\nThe topics on which the activities revolve are work life, family life, city life and outdoor life. As you can see, a bit of everything to be able talk about yourself and to engage in everyday communication.\n\nWe hope you like our menu. ¡Buen provecho! (Bon appétit!)',NULL,NULL,'EN',1,'/courses/018/cover-75a63709.png','BASIC_PROFESSIONAL','2021-01-06 17:07:27',NULL,'2021-01-06 17:07:00',0),('9bdee9ce-ae0d-4eba-aba6-2157b8c42c9c','006','Marketing Analytics: Marketing Measurement Strategy','Begin your journey in a new career in marketing analytics. Learn about powerful strategies and methodology, starting with identifying market trends and metrics used to measure marketing success.\n\nIn this marketing course, you will learn how to execute market sizing, identify market trends, and predict future conditions.\n\nThis course is taught by Stephan Sorger who has held leadership roles in marketing and product development at companies such as Oracle, 3Com and NASA. He has also taught for over a decade at UC Berkeley Extension and is the author of two widely adopted marketing textbooks. This course will equip you with the knowledge and skills necessary to immediately see practical benefits in the workplace.',NULL,NULL,'EN',1,'/courses/006/cover-9bdee9ce.jpeg','','2021-01-11 08:28:29',NULL,'2020-12-26 17:31:28',0),('a093120f-b0f0-4f8c-89ff-d60e1556fe00','004','Cómo educar teniendo en cuenta la muerte','Los educadores nos formamos para poder educar para la vida. Pero, sin incluir la muerte de una manera consciente, esta acción siempre estará incompleta y mal enfocada, por lo que la educación plena no será posible.',NULL,NULL,'ES',1,'/courses/004/cover-a093120f.jpeg',NULL,'2020-12-23 15:09:29',NULL,'2020-12-23 15:08:58',0),('aad96895-b6ac-4f88-bc0a-dccecfb621cb','032','StartUp course',NULL,NULL,NULL,NULL,0,'/courses/032/cover-aad96895.jpeg','FREE','2021-02-09 20:35:01',NULL,'2021-02-09 20:34:31',0),('cf41da32-e324-4c2a-bad0-c3906703b87a','017','Spanish 2: One Step Further','Bienvenidos y bienvenidas! (Welcome!) In this Spanish course, you will learn basic vocabulary to talk about yourself and your everyday life, in the present and in the past, in simple and brief communication situations, as well as about plans for an immediate future. At the end of the course you will be able to communicate in everyday situations according to the A1 proficiency level as described in the Common European Framework of Reference for Languages (CEFRL, Council of Europe).\n\nThe course, which is designed for English speakers, offers a variety of exercises after going through the stages of content presentation, comprehension and production. You have videos, small texts and audios to improve your pronunciation, glossaries, activities for oral practice with other course students, quizzes, grammar cards and recommendations on external Internet resources to continue learning more and more Spanish.\n\nThe topics on which the activities revolve are work life, family life, city life and outdoor life. As you can see, a bit of everything to be able talk about yourself and to engage in everyday communication.\n\nWe hope you like our menu. ¡Buen provecho! (Bon appétit!)',NULL,NULL,'EN',1,NULL,'BASIC_PROFESSIONAL','2021-01-06 16:55:44',NULL,'2021-01-06 16:55:44',0),('e8289e80-0def-4f32-b129-343f70373405','033','Data Science','Fundamental R programming skills\nStatistical concepts such as probability, inference, and modeling and how to apply them in practice\nGain experience with the tidyverse, including data visualization with ggplot2 and data wrangling with dplyr',NULL,1,NULL,1,'/courses/033/cover-e8289e80.jpeg','BASIC_PROFESSIONAL','2021-02-12 18:36:35',NULL,'2021-02-12 18:21:05',0);
