INSERT INTO `data_rooms` VALUES ('19a23dd2-89a1-4089-a6ce-d17eb9e5073c','011','oka','Reset  and Send it again',NULL,NULL,'2021-04-09 18:54:44','2021-04-09 18:54:44','d761c981-3502-49e4-a425-ef189f97e5bf'),('26e09a2b-c53a-48e0-af74-9aa7d6598ac0','018','What is a curriculum vitae? A curriculum vitae (CV), Latin for \"course of life,\" is a detailed professional document highlighting a person\'s education, experience and accomplishments. A CV may also include professional references, as well as coursework, fieldwork, hobbies and interests relevant to your profession.','Modelo de Curriculum',NULL,NULL,'2021-04-17 06:31:13','2021-04-17 06:31:13','d761c981-3502-49e4-a425-ef189f97e5bf'),('274bf102-003c-4ee9-ac53-42b466de7ec5','019','I have input file (without submit - typicall input file). I\'d like to call some function when chose file. Example: I click on \"Choose file\" -> choose file -> now system detects change and call some function which prints all these file information (for example image name).','Milenium Falcon',NULL,NULL,'2021-04-17 10:19:32','2021-04-17 10:19:32','d761c981-3502-49e4-a425-ef189f97e5bf'),('4e569373-35c0-4909-bf02-77813d3943fd','010','oka','Reset  and Send it again',NULL,NULL,'2021-04-09 18:48:37','2021-04-09 18:48:37','d761c981-3502-49e4-a425-ef189f97e5bf'),('53c68aa9-3253-4e6b-a907-94444a07299b','016','Are you a Senior Software Engineer living outside the U.S.? Interested in top remote U.S. Software jobs? Sign up for Turing if:\n1) You can work full time (40 hours/week) with a U.S. software company.\n2) You can spend 5 hours in the next week on our programming tests, challenges, and our video interviews.\n3) You can adjust work hours to overlap at least 4 hours a day with a company in San Francisco/New York.\n4) You are a very talented software engineer, likely in the top 1% of the world’s software engineers. Three years of industry experience preferable, but we relax this requirement if you are exceptionally skilled.\n5) You will be able to communicate effectively in english over daily video calls with engineering managers at U.S. Software companies we match you with.\n---------------------------------------------------------\nBenefits of signing up for Turing:\n1) No US visa needed since you’ll be working remotely.\n2) Higher Salary than local jobs in most countries.\n3) Full time, long term jobs.\n4) Jobs across a variety of software skills including Front-end, UIUX, back-end, Full stack, Mobile, DevOps, AI etc.\n5) Jobs across various levels - Software engineer (SWE), senior SWE, tech lead and eng manager.\n---------------------------------------------------------\nAbout Turing:\n1) Based in Palo Alto, California founded by Jonathan Siddharth and Vijay Krishnan.\n2) Founders Jonathan and Vijay originally moved to the U.S from India when they got accepted into the Computer Science program at Stanford University. Being software engineers themselves, they realized how much their software career prospects improved merely as a result of relocating to the Silicon Valley. Turing’s mission is to make the same opportunities available to Silicon Valley engineers accessible to exceptional engineers all over the world.\n3) Today, we have matched Turing software engineers from 50+ countries in all continents to remote jobs with our partner companies in the US.\n----------------------------------------------------------\nReady to start?\n1) Sign Up.\n2) Upload your resume and create your profile.\n3) Pass Turing\'s tests and interviews\n4) Get matched to U.S. software roles!','About Turing',NULL,NULL,'2021-04-10 07:09:55','2021-04-10 07:09:55','d761c981-3502-49e4-a425-ef189f97e5bf'),('57c88b10-1816-44d1-9319-1d635dade4d3','003','oka','oka',NULL,NULL,'2021-04-09 17:13:33','2021-04-09 17:13:33','d761c981-3502-49e4-a425-ef189f97e5bf'),('70c8cfba-f516-40ef-b520-fbf14fdeea10','017',NULL,'Everest',NULL,NULL,'2021-04-10 07:57:26','2021-04-10 07:57:26','d761c981-3502-49e4-a425-ef189f97e5bf'),('711e5255-7d5f-4e2b-bf80-078d0f