INSERT INTO `evaluations` VALUES ('1c37b67f-886c-40ed-af01-8934130d61f4',NULL,'Família','Avalia a harmonia que existe entre os membros da família, a capacidade de perdoar e conviver amorosamente, apesar das diferenças pessoais. Avalia também a harmonia e o amor existente entre um casal, a quantidade e a qualidade do sexo e a capacidade de fazer o outro feliz---','Pessoal',1,'2020-11-08 09:24:17','2020-12-17 13:17:44'),('6295a5b1-421b-442b-afd4-d5cce44e822a',NULL,'Saúde','Avalia a vitalidade e disposição física , o preparo físico, energia, flexibilidade e ausência de dores, nível de obesidade e de limitações físicas','Pessoal',1,'2020-11-08 09:24:17','2020-11-08 09:24:17'),('716d5af5-1638-45d3-bf33-10d93ebafae7',NULL,'Evolução na carreira','Avalia a sua carreira profissional, em termos de crescimento e desempenho na empresa, com fornecedores e clientes.','Profissional',1,'2020-11-08 09:24:17','2020-12-17 13:16:32'),('f243900c-2c10-4670-8717-058cb3e9715f',NULL,'Desempenho','Avalia o grau de concretização dos objectivos profissionais, ou seja, capacidade de alcance dos objectivos estabelecidos pela sua chefia/ organização.','Profissional',1,NULL,NULL),('f243900c-2c11-4670-8717-058cb3e9715f',NULL,'Relacionamentos','valia a qualidade dos relacionamentos que mantém no local de trabalho com colegas, subordinados e chefias.','Profissional',1,NULL,NULL),('f243900c-2c12-4670-8717-058cb3e9715f',NULL,'Rendimentos','Avalia o quanto seus ganhos regulares são suficientes para cobrir as suas despesas.','Financeiro',1,NULL,NULL),('f243900c-2c13-4670-8717-058cb3e9715f',NULL,'Poupanças','Avalia se efectua ou não poupanças mensais e o quanto essas poupanças são ou não suficientes para face aos imprevistos e necessidades de investimentos.','Financeiro',1,NULL,NULL),('f243900c-2c14-4670-8717-058cb3e9715f',NULL,'Investimentos','Avalia se tem ou não investimentos (activos que geram receitas) e o quanto esses investimentos produzem ou não as receitas esperadas.','Financeiro',1,NULL,NULL),('f243900c-2c15-4670-8717-058cb3e9715f',NULL,'Social','Avalia a qualidade e a quantidade das amizades e iterações sociais, a prática de um hobby, ou seja, uma actividade com objectivo de descontrair e descarregar as tensões do dia a dia.','Pessoal',1,'2020-11-08 09:24:17','2020-11-08 09:24:17');
/*!40000 ALTER TABLE `evaluations` ENABLE KEYS */;
